import "./App.css";import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from '/components/Home';
import Products from './components/Products';
import Product from './components/Product';
import AdminProducts from './components/AdminProducts';
import AddProducts from './components/AddProducts';
import UpdateProduct from './components/UpdateProduct';
import Cart from './components/Cart';
import Login from './components/Login';
import SignUp from './components/SignUp';
import PrivateComponent from './components/PrivateComponent';
import Navbar from './components/Navbar';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route exact path="/" element={<Home/>} />
        <Route exact path="/products" element={<Products />} />
        <Route exact path="/cart" element={<PrivateComponent element={<Cart/>} />} />
        {/* <Route exact path="/profile" element={<PrivateComponent element={<Profile />} />} /> */}
        <Route exact path="/products/:id" element={<Product />} />
        <Route exact path="/adminProducts" element={<PrivateComponent element={<AdminProducts />} />} />
        <Route exact path="/addProducts" element={<PrivateComponent element={<AddProducts />} />} />
        <Route exact path="/updateProduct/:id" element={<PrivateComponent element={<UpdateProduct />} />} />
        <Route exact path="/login" element={<Login />} />
        <Route exact path="/signup" element={<SignUp />} />
      </Routes>
    </Router>
  );
}

export default App;
